    const {id} = useParams();
         
  const [info , setInfo]=useState({
    arr:"" , prr:"" , arrdata :[]
  });

  function Loaddata(){
    axios.get("/get-specific/"+id )
    .then((res)=> {
       console.log(res);
      setInfo({
        arrdata : res.data.card
      })
    })
    .catch((err)=>{
        console.log(err); 
      })
}

    useEffect(()=>{
      Loaddata();
    }, []
  )


    return(
        <>
       <form onSubmit="editdata()"> 
        <input type="text" placeholder="edit your prr name"></input>
        
        <input type="submit" ></input>
        </form>
        
        </>


    )

}
export default EditPost;
